import "./layout.css";
const Header = () => {
  return (
    <nav>
      <div className="nav-wrapper">
        <ul className="d-flex justify-content-between left">
          <li>
            <img
              alt="logo"
              src="https://www.luminskin.com/_next/static/images/logo-20c2cb1d9d2bb6d2139d0e5cec3103bd.png"
              className="logo"
            />
          </li>
          <li>Shop</li>
          <li>About</li>
          <li>Support</li>
          <li>Blog</li>
        </ul>
      </div>
    </nav>
  );
};

export default Header;
